import React, { useState } from "react";
import { connect } from "react-redux";
import { useNavigate } from "react-router";
import { toast } from "react-toastify";
import Nav from "../../../../Nav";
import axios from "axios";
import Avatar from "@mui/material/Avatar";
import Button from "@mui/material/Button";

const AddProject = ({ projects, addProject }) => {
  const [name, setName] = useState("");
  const [type, setType] = useState("");
  const [desc, setDesc] = useState("");
  const [teamNeeded, setTeamNeeded] = useState("");
  const [level, setLevel] = useState("");
  const [location, setLocation] = useState("");

  const navigate = useNavigate();

  const handleSubmit = (e) => {
    e.preventDefault();
    const checkProjectNameExists = projects.filter((project) =>
      project.name === name ? project : null
    );

    if (!type || !name || !desc || !teamNeeded || !level || !location) {
      return toast.warning("Please fill in all fields!!");
    }
    if (checkProjectNameExists.length > 0) {
      return toast.error("This project name already exists!!");
    }

    const data = {
      id: projects.length > 0 ? projects[projects.length - 1].id + 1 : 0,
      desc,
      name,
      level,
      teamNeeded,
      location,
      type,
    };

    addProject(data);
    toast.success("Your Request sent successfully!!");
    navigate("/myprojects");
  };

  return (
    <>
      <Nav />
      <div style={{paddingTop:"180px", paddingBottom:"120px"}}>
        <h1 className="text-center py-3 display-2" style={{fontSize:"40px", fontWeight:"600", color:"#00468B"}}>Add Project</h1>
        <div style={{color:"white"}}>
          <div className="col-md-6 p-5 mx-auto shadow">
            <form onSubmit={handleSubmit}>
              <div className="form-group" style={{marginBottom:"10px"}}>
                <input
                  className="form-control"
                  value={name}
                  placeholder={"Project Name"}
                  onChange={(e) => setName(e.target.value)}
                />
              </div>
              <div className="form-group" style={{marginBottom:"10px"}}>
                <input
                  className="form-control"
                  value={desc}
                  placeholder={"Description"}
                  onChange={(e) => setDesc(e.target.value)}
                />
              </div>
              <div className="form-group" style={{marginBottom:"10px"}}>
                <input
                  className="form-control"
                  value={type}
                  placeholder={"Project Type"}
                  onChange={(e) => setType(e.target.value)}
                />
              </div>
              <div className="form-group" style={{marginBottom:"10px"}}>
                <input
                  className="form-control"
                  value={teamNeeded}
                  placeholder={"Teem needed"}
                  onChange={(e) => setTeamNeeded(e.target.value)}
                />
              </div>
              <div className="form-group" style={{marginBottom:"10px"}}>
                <input
                  className="form-control"
                  value={location}
                  placeholder={"Where are you"}
                  onChange={(e) => setLocation(e.target.value)}
                />
              </div>
              <div className="form-group" style={{marginBottom:"10px"}}>
                <input
                  className="form-control"
                  value={level}
                  placeholder={"Whats the level of project?"}
                  onChange={(e) => setLevel(e.target.value)}
                />

              </div>
              <div className="form-group">
              <Button
                type="submit"
                fullWidth
                variant="contained"
                sx={{
                  ":hover": {
                    bgcolor: "#e4a300",
                  },
                  mt: 3,
                  mb: 2,
                  backgroundColor: "#FFB703",
                }}

              >
                Add Project
              </Button>

              </div>
            </form>
          </div>
        </div>
      </div>
    </>
  );
};

const mapStateToProps = (state) => ({
  projects: state,
});
const mapDispatchToProps = (dispatch) => ({
  addProject: (data) => {
    dispatch({ type: "ADD_PROJECT", payload: data });
  },
});

export default connect(mapStateToProps, mapDispatchToProps)(AddProject);
